import React, { Component } from "react";

import Select from "react-select";

const selectOptions = [
  {
    value: "Object",
    label: "Object",
  },
  {
    value: "Location",
    label: "Location",
  },
  {
    value: "Space",
    label: "Space",
  },
];

export default () => (
  <Select
    defaultValue={[selectOptions[2], selectOptions[3]]}
    isMulti
    name="colors"
    options={selectOptions}
    className="basic-multi-select"
    classNamePrefix="select"
  />
);
